B.N6=new A.I(7,{id:1675875084441,question:"Explain the use of Hive in Hadoop eco-system.",answer:"- Hive provides an interface to manage data stored in Hadoop eco-system. \n- Hive is used for mapping and working with HBase tables.\n-  Hive queries are converted into MapReduce jobs in order to hide the complexity associated with creating and running MapReduce jobs.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.i,t.M)
