B.Mr=new A.I(7,{id:1675875222365,question:"What is COSHH?",answer:"**Classification and Optimization-based Scheduling for Heterogeneous Hadoop Systems**(COSHH), as the name implies, enables scheduling at both the cluster and application levels to have a direct positive impact on task completion time.\n\n",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.MN=new A.I(7,{id:1675875316968,question:"What are Skewed tables in Hive?",answer:"- Skewed tables are a type of table in which some values in a column appear more frequently than others.\n- The distribution is skewed as a result of this. \n- When a table is created in Hive with the SKEWED option, the skewed values are written to separate files, while the remaining data are written to another file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.i,t.M)
